import React from "react";
import { Link } from "react-router-dom";

function Notifications() {
  return (
    <Link to="#" className="notification">
      <span>
        <FeatherIcon icon="bell" />
      </span>
      <span className="badge">3</span>
    </Link>
  );
}

export default Notifications;
